import React from 'react';
import Topics from './topics'
import './App.css';

function LinkTopics() {
return( <ul className="link-topics">
            <Topics name="Technology"/>
            <Topics name="Bussiness"/>
            <Topics name="Stock-Market"/>
            <Topics name="Opinion"/>
            <Topics name="Politics"/>
            <Topics name="2020 Election"/>
            <Topics name="Sports"/>
            <Topics name="Covid-19"/>
        </ul>);
}


export default LinkTopics;
